import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";
import { Link } from "react-router-dom";
import NavHeader from '../../NavHeader';
import MediaPlayer from '../../Mediaplayer';
import Apps from '../../trail';
import Slider from '../../image_slider';

import Cimage from './photoco/cimage';
import { Button } from 'mdbreact';
import Image from './photoco/setiaI';
import Image1 from './photoco/armanI';
import AriJit from '../../photoco/arijitI';
import AtIf from '../photoco/atifI';
import HoneySingh from './photoco/honey';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import '../../App.css'


class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;

    return (
      <div style={{ height: "75vh" }} className="container valign-wrapper">
        <div className="row">
          <div className="landing-copy col s12 center-align">
            <h4>
              <b>Hey there,Welcome to the HomePage</b> {user}

            </h4>

            <div className="full-height">
						<Router>
							<Apps />
						</Router>

						<NavHeader />

					</div>
          <div style={{ marginTop: 30 }}>

						<Slider />


					</div>


					<div className="media">
						<MediaPlayer />
					</div>
					<div>
						<div className="artist">
							<div >
								<a className="art">
									Artist
							</a>
								</div>
							<div id="menu-outer">
									<div class="table">

										<ul id="horizontal-list">


											<li><Button><Cimage /></Button></li>

										</ul>
									</div>
								</div>
								<div id="menu-outer1">
									<div class="table1">

										<ul id="horizontal-list1">

											<Button><Image /></Button>

										</ul>
									</div>
								</div>

								<div id="menu-outer2">
									<div class="table2">

										<ul id="horizontal-list2">

											<Button><Image1 /></Button>

										</ul>
									</div>
								</div>

								<div id="menu-outer3">
									<div class="table3">

										<ul id="horizontal-list3">

											<Button><AriJit /></Button>

										</ul>
									</div>
								</div>


								<div id="menu-outer4">
									<div class="table4">

										<ul id="horizontal-list4">

											<Button><AtIf /></Button>

										</ul>
									</div>
								</div>


								<div id="menu-outer5">
									<div class="table5">

										<ul id="horizontal-list5">

											<Button><HoneySingh /></Button>

										</ul>

									</div>
								</div>
							</div>

						</div>


            <div>
            <Link to="/login">

            <b>  Logout</b>

            </Link>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
